import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";

export const Type = {
  bg: "background",
  img: "image",
};

const Image = ({
  style: { circle = false },
  option: { src = "", type = Type.img },
}) => {
  const srcPath = "/assets/images/" + src;

  return (
    <>
      {console.log(circle)}
