        <Styled.Image className={className} src={srcPath} circle={circle} />
      ) : (
        <Styled.Background
          className={className}
          src={srcPath}
        ></Styled.Background>
      )}
    </>
  );
};

Image.propTypes = {
  className: propTypes.string,
  src: propTypes.string.isRequired,
  type: propTypes.string,
  circle: propTypes.bool,
};

export default Image;
